import 'react-bootstrap';
function Contact() {
      return (
        <div className="contact">
        <div class="container">
          <div class="row align-items-center my-5">
            <div class="col-lg-5">
            <h1 class="font-weight-light">Contact</h1>
                 <div><a href="mailto: aks.auburn@gmail.com"> Email: aks.auburn@gmail.com</a></div> 
                  </div>
        </div>
      </div>
    </div>
      );
    }

  export default Contact;
